import React from 'react';
import Iframe from 'react-iframe';
import './project.css';

const ProjectUI = () => {
    return (
        <div>
         
        <Iframe url="https://charlielaver.github.io/netflix-in-react-deploy/"
        
        className="project"
        display="initial"
        position="relative"/>

    </div>
    )
}

export default ProjectUI
